//import { useState, useEffect } from "react";
import SneakersCard from "../components/sneakersCard";
import { Link } from "react-router-dom";
import "../style/menWoman.css";
import data from "../data/shoesList_male_data.json";

function Men() {
	return (
		<div className='main_container'>
			<div className='left_section'></div>
			<div className='right_section'>
				{data.map((element, index) => {
					return (
						<div key={element.id} className='SneakersCard_container'>
							<Link
								className='card_Link'
								to={window.location.href}
								state={{ id: "occupation" }}
							>
								<SneakersCard
									price={element.price}
									rating={parseFloat(element.rating)}
									img={element.imgUrl}
									starSize='medium'
									promo={element.promotion}
								/>
							</Link>
						</div>
					);
				})}
			</div>
		</div>
	);
}

export default Men;

